import resim4 from "../resimler/araba4.jpg";
import resim5 from "../resimler/araba5.jpg";



const Slayt =() =>{


    const slides =[
        {url:resim1},
        {url:resim2},
        {url:resim3},
        {url:resim4},
        {url:resim5},

    ];
    const containerStyles ={
        width:"1500px",
        height:"600px",
        margin:"0px auto",

    };
    return(
        <div>
            <div style={containerStyles}>
            <ImageSlider slides={slides} />
            </div>
        </div>
    )
}

export default Slayt;
